import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

const RetList = (props) => {

    const RemoveElement = (event) => {
        const id = event.target.id;

        props.SetV((preList) => {
            let arr = [...preList];
            arr.splice(id, 1);
            return arr;
        });

    }

    const data = props.data.map((val, index) => {
        return (
            <p key={index}><button id={index} className="btnSub" onClick={RemoveElement}>
               <DeleteIcon/> </button> {val}
            </p>
        );
    });
    return data;
}

export default RetList;
